create database road_accidents;
use road_accidents;

CREATE TABLE Locations (
    LocationID INT PRIMARY KEY,
    City VARCHAR(50),
    RoadType VARCHAR(30)
);

CREATE TABLE Weather (
    WeatherID INT PRIMARY KEY,
    Date_ DATE,
    ConditionType VARCHAR(10), -- 'Dry' or 'Rainy'
    Temperature INT,
    Visibility DECIMAL(3,1)
);

CREATE TABLE Accidents (
    AccidentID INT PRIMARY KEY,
    Date_ DATE,
    Time_ TIME,
    LocationID INT,
    WeatherID INT,
    Severity VARCHAR(10), -- 'Minor', 'Major', 'Fatal'
    VehiclesInvolved INT,
    VictimsInvolved INT,
    FOREIGN KEY (LocationID) REFERENCES Locations(LocationID),
    FOREIGN KEY (WeatherID) REFERENCES Weather(WeatherID)
);

-- Vehicles (VehicleID, AccidentID, Type_, DamageLevel, IsFaulty
CREATE TABLE Vehicles (
    VehicleID INT PRIMARY KEY,
    AccidentID INT,
    Type_ VARCHAR(20), -- Car, Bike, Truck, Bus
    DamageLevel VARCHAR(10), -- Minor, Moderate, Severe
    IsFaulty BOOLEAN,
    FOREIGN KEY (AccidentID) REFERENCES Accidents(AccidentID)
);

CREATE TABLE Victims (
    VictimID INT PRIMARY KEY,
    AccidentID INT,
    Age INT,
    Gender VARCHAR(10),
    Role VARCHAR(15), -- Driver, Passenger, Pedestrian
    InjurySeverity VARCHAR(10), -- Minor, Serious, Fatal
    FOREIGN KEY (AccidentID) REFERENCES Accidents(AccidentID)
);








